import Header from '../components/header';
import Footer from '../components/footer';
import Section from "../components/section";
import ProductWrap from "../components/productWrap";

export default function Home(){
    return (
        <div>
            <Header />
            <ProductWrap/>
            <Section />
            <ProductWrap/>
            <Footer/>
        </div>
    )
}
